import React, { useState } from 'react';
import { Modal } from 'antd';
import {
  Add,
  Header,
  MenuH,
  MenuV,
  Toggle,
  Wrapper,
  IconWrapper,
  Input,SortContent,
  InputWraper,Search,Sort,SortImg
} from './style';
import search from '../../../assets/imgs/search.png'
import sort from '../../../assets/imgs/sort.png'
export const Mahsulotqoshish= ({ onClick }) => {
  const [isActive, setIsActive] = useState('Yangi');
  const [on, setOn] = useState(true);

  const [isModalVisible, setIsModalVisible] = useState(false);

  const showModal = () => {
    setIsModalVisible(true);
  };

  const handleOk = () => {
    setIsModalVisible(false);
  };

  const handleCancel = () => {
    setIsModalVisible(false);
  };

  return (
    <Header>
 
      <Wrapper order='1'>
        <Add.Plus />
        <Add.Title>Yangi buyurtma <span style={{display:'block',fontWeight:'bold'}}>qo'shish</span></Add.Title>
        <Toggle toggle>
          <IconWrapper active={on} onClick={() => setOn(true)}>
            <MenuH active={on} />
          </IconWrapper>
          <IconWrapper active={!on} onClick={() => setOn(false)}>
            <MenuV active={!on} />
          </IconWrapper>
        </Toggle>
      </Wrapper>
 
      <Wrapper center order='2' >

           <InputWraper>
                  <Input placeholder='Qidirish' />
                  <Search  src={search}/>
           </InputWraper>
           
           <Sort onClick={showModal}>
               <SortContent>
                  <SortImg  src={sort}/>
               </SortContent>
           </Sort>
           <Button type="primary" onClick={showModal}>
           Open Modal
         </Button>
         
           <Modal title="Basic Modal" visible={isModalVisible} onOk={handleOk} onCancel={handleCancel}>
               <p>Some contents...</p>
           </Modal>
         
      </Wrapper>

    </Header>
  );
};

export default Mahsulotqoshish;
